import{_,o as t,c as p,a7 as s}from"./chunks/framework.CmR4KQfH.js";const a="/images/2009/01/24_31_135200_24_6609.jpg",e="/images/2009/01/24_31_135200_4_6613.jpg",i="/images/2009/01/24_31_135200_7_6614.jpg",o="/images/2009/01/24_31_135200_11_6617.jpg",r="/images/2009/01/24_31_135200_14_6618.jpg",c="/images/2009/01/24_31_135200_16_6619.jpg",m="/images/2009/01/24_31_135200_18_6621.jpg",g="/images/2009/01/24_31_135200_21_6623.jpg",n="/images/2009/01/24_31_135200_23_6625.jpg",$=JSON.parse('{"title":"1月23日·骑行汕头，吃牛丸、游庵寺","description":"","frontmatter":{"title":"1月23日·骑行汕头，吃牛丸、游庵寺","tags":["汕头","潮州","单车"],"id":1067,"categories":["Life"],"abbrlink":"5f2a3596","date":"2009-01-31T13:52:00.000Z"},"headers":[],"relativePath":"Life/1月23日骑行汕头_吃牛丸、游庵寺.md","filePath":"Life/1月23日骑行汕头_吃牛丸、游庵寺.md","lastUpdated":1720625041000}'),d={name:"Life/1月23日骑行汕头_吃牛丸、游庵寺.md"},l=s('<p>23日，回家的第二天，一早7点出门，在路边吃了肠粉，白菜多了点，不过比起深圳的，还是非常好吃的</p><p>7点半上路，一路阴天，刚进汕头还下起细雨，还好不大，2个小时后抵达汕头金砂西路，吃了正宗的福合埕牛肉丸，丸子不错，沙茶酱就逊色了点</p><p>吃完雨也停了，坐上公车前往达濠区的巨峰寺，汕头市区蒙蒙细雨，达濠区确实天清气朗，下车后又步行了20来分钟，才到了巨峰寺，估计海拔不过百米</p><p>本来是去看桃花的，可是去的不是时候，还只是花苞 <img src="'+a+'" alt=""> 潮州市区 -&gt; 汕头市区 42km 汕头市区 -&gt; 巨峰寺 20km</p><p>可以打乒乓球的汕头牛肉丸</p><p><img src="'+e+'" alt=""></p><p><img src="'+i+'" alt=""> 好吃的木瓜树</p><p>美死人的茶花</p><p><img src="'+o+'" alt=""></p><p>吓死我了，后面是悬崖</p><p><img src="'+r+'" alt=""> 后面那石头像猪吧，就叫“猪福满庭”</p><p><img src="'+c+'" alt=""></p><p><img src="'+m+'" alt=""></p><p><img src="'+g+'" alt=""></p><p><img src="'+n+'" alt=""> 宕石大桥</p>',15),f=[l];function j(T,h,k,u,S,L){return t(),p("div",{"data-pagefind-body":!0},f)}const b=_(d,[["render",j]]);export{$ as __pageData,b as default};
